--// esp
local CreateClass = function(Class, Properties)
	local ClassInt = typeof(Class) == "string" and Instance.new(Class) or Class
	--
	for Property, Value in next, Properties do
		ClassInt[Property] = Value
	end
	--
	return ClassInt
end


local ESPHolder = CreateClass("ScreenGui", {
	Parent = game:GetService("CoreGui");
	Name   = "ESPHolder";
})

local DupeCheck = function(plr)
	if ESPHolder:FindFirstChild(plr.Name) then
		ESPHolder[plr.Name]:Destroy()
	end
end

local DistanceCheck = function(Player)
	return math.floor((Player.Position - framework.variables.camera.CFrame.Position).Magnitude)
end 

local SleepCheck = function(plr)
    for i,v in plr.AnimationController:GetPlayingAnimationTracks() do
        if v.IsPlaying and v.Animation.AnimationId == "rbxassetid://13280887764" then
            return true;
        end
    end
    return false;
end

