local HitboxLog = false
local updatehitbox = function()
    for i,v in pairs(workspace:GetChildren()) do
        if v:FindFirstChild("Head") and v:FindFirstChild("Torso") then
            if framework.combat.hitbox.enabled then
                HitboxLog = true
                v.Head.Size = Vector3.new(framework.combat.hitbox.width, framework.combat.hitbox.height, framework.combat.hitbox.width)
                v.Head.CanCollide = false
                v.Head.Transparency = 0.8
            else
                if HitboxLog and v.Head.Size ~= Vector3.new(1.672248125076294, 0.835624098777771, 0.835624098777771) then
                    v.Head.Size = Vector3.new(1.672248125076294, 0.835624098777771, 0.835624098777771)
                    v.Head.CanCollide = true
                    v.Head.Transparency = 0
                end
            end
        end
    end
end
workspace.ChildAdded:Connect(function(v)
    if v:FindFirstChild("Head") and v:FindFirstChild("Torso") then
