--// Get Player
local function getplayer()
    local closest = nil
    local closestMagnitude = math.huge
    for i,v in pairs(workspace:GetChildren()) do
        if v:FindFirstChild("HumanoidRootPart") and not SleepCheck(v) and v.Head.Nametag.tag.Text ~= "Shylou2644" then
            local PartPos, OnScreen = framework.variables.camera.WorldToViewportPoint(framework.variables.camera, v:GetPivot().Position)
            local Magnitude = (Vector2.new(PartPos.X, PartPos.Y) - Vector2.new(framework.variables.camera.ViewportSize.X / 2, framework.variables.camera.ViewportSize.Y / 2)).magnitude
            local PlayerDistance = (framework.variables.camera.CFrame.Position - v:GetPivot().Position).Magnitude
            if Magnitude < fovcircle.Radius and PlayerDistance <= 1500 and Magnitude < closestMagnitude and OnScreen then
                closestMagnitude = Magnitude
                closest = v
            end
        end
    end
    return closest
end

local Target = nil
local Aiming = false
game:GetService("UserInputService").InputBegan:Connect(function(input, gme)
    if gme then return end

    if framework.combat.aimbot.holding and not Target and not Aiming and not framework.combat.aimbot.controller then
        Aiming = true
        repeat wait() until getplayer() ~= nil and Aiming
        if Aiming and getplayer() ~= nil then
            Target = getplayer()
        end
    elseif (input.UserInputType == Enum.UserInputType.Gamepad1 and input.KeyCode == Enum.KeyCode.ButtonL2) and framework.combat.aimbot.controller then
        if not Target and not Aiming then
            Aiming = true
            repeat wait() until getplayer() ~= nil and Aiming
            if Aiming and getplayer() ~= nil then
                Target = getplayer()
            end
        end
    end
end)

game:GetService("UserInputService").InputEnded:Connect(function(input, gme)
    if gme then return end

    if not framework.combat.aimbot.holding and Aiming and not framework.combat.aimbot.controller then
        Target = nil
        Aiming = false
    elseif (input.UserInputType == Enum.UserInputType.Gamepad1 and input.KeyCode == Enum.KeyCode.ButtonL2) and framework.combat.aimbot.controller then
        if Aiming then
            Target = nil
            Aiming = false
        end
    end
end)



