local GetHoldingWeapon = function()
    if workspace.Ignore:FindFirstChild("FPSArms") and workspace.Ignore.FPSArms:FindFirstChild("HandModel") then
        local HandModel = workspace.Ignore.FPSArms.HandModel
        if HandModel and HandModel:GetAttribute("name") then
            return tostring(HandModel:GetAttribute("name"))
        end
    end
    return "None"
end
local GetProjectileInfo = function()
    local Weapon = GetHoldingWeapon()
    if Weapon ~= "None" then
        local Info = projectileinfo[Weapon]
        return Info.Speed, Info.Drop
    end
    return nil
end

local CurrentPos = Vector3.new(0, 0, 0)
local LastVelocity = Vector3.new(0, 0, 0)

local CalculateVelocity = function(PlayerPart, CurrentPos, LastVelocity, Delta)
    local NewPos = PlayerPart.Position
    local DistTrav = (NewPos - CurrentPos)
    local Vel = DistTrav / Delta

    LastVelocity = LastVelocity:Lerp(Vel, 0.1)

    return LastVelocity, NewPos
end

local CalculateBulletDrop = function(tVel)
