end;



--// XRAY
local SetXRAY = function(t)
    local Parts = {"Hitbox", "Prim", "Meshes/triangle", "Enclosure"}
    local Doors = {"RightWall", "LeftWall", "Frame", "Union", "Door", "Hinge", "Wall", "RightHinge", "LeftHinge", "RightHandle", "LeftHandle", "Handle"}

    for _, v in pairs(game:GetService("Workspace"):GetChildren()) do
        for _, Part in ipairs(Parts) do
            local part = v:FindFirstChild(Part)
            if part then
                part.Transparency = t or 0
            end
        end

        for _, Door in ipairs(Doors) do
            local door = v:FindFirstChild(Door)
            if door then
                door.Transparency = t or 0
            end
        end
    end
end


