do -- src/Lua/Scripts/da_hood/components/f_settings.lua
    local config = {
        path = "frag/configs/trident/",
        file = "",
        config_name = ""
    }
    function config:get_list()
        local config_list = {}
    
        if #listfiles("frag/configs/trident") > 0 then
            for i, v in next, listfiles("frag/configs/trident") do
                local ext = '.'..v:split('.')[#v:split('.')];
                if ext == '.txt' then
                    table.insert(config_list, v:split('\\')[#v:split('\\')]:sub(1,-#ext-1))
                end
            end
        else
            config_list = {}
        end
    
        return config_list
    end
    
    local settingsTab = Interface:Tab( "settings." )
    
    local profiles = settingsTab:Section("configuration", "left")
    
    profiles:TextBox({ title = "NO TITLE", default = "", placeholder = "config name", ClearTextOnFocus = true, callback = function (value)
        config.config_name = value
    end })
    
    local configs_list, funcs = profiles:Dropdown({ title = "configs", values = config:get_list(), default = "--", multi = false, callback = function (value)
        config.file = value
    end })
    
    profiles:Button({ title = "load config", callback = function ()
        if config.file == nil then print("Config file nil") return end
    
        local SelectedConfig = config.path..config.file;
        if SelectedConfig then
            print("Tried to load", SelectedConfig)
            print(readfile(SelectedConfig .. ".txt"));
            UserInterface:LoadConfig(readfile(SelectedConfig .. ".txt"))
        end
        funcs:Refresh(config:get_list())
    end })
    
    profiles:Button({ title = "save config", callback = function ()
        if config.config_name ~= "" then
            writefile(config.path .. config.config_name .. ".txt", UserInterface:GetConfig())
            funcs:Refresh(config:get_list())
        end
    end })
    
    profiles:Button({ title = "delete config", callback = function ()
        local SelectedConfig = config.file;
        if SelectedConfig then
            delfile(config.path .. SelectedConfig .. ".txt")
        end
        funcs:Refresh(config:get_list())
    end })
    
    profiles:Button({ title = "refresh list", callback = function ()
        funcs:Refresh(config:get_list())
    end})

    profiles:Toggle({ title = "keybinds", default = true, callback = function(bool)
        if game:GetService("CoreGui"):FindFirstChild("intellectmen") and game:GetService("CoreGui").intellectmen:FindFirstChild("KeybindsList") then
            game:GetService("CoreGui").intellectmen:FindFirstChild("KeybindsList").Visible = bool
        end
    end})
end



game:GetService("RunService").Heartbeat:Connect(function(Delta)
    if framework.combat.aimbot.enabled and Target ~= nil and Target:FindFirstChild("Head") then
        LastVelocity, CurrentPos = CalculateVelocity(Target["Head"], CurrentPos, LastVelocity, Delta)
        local Position, OnScreen = framework.variables.camera:WorldToViewportPoint(CalculateBulletDrop(LastVelocity))
        if OnScreen then
            local MouseLocation = framework.variables.userinputservice:GetMouseLocation()
            local XOffset, YOffset = framework.combat.aimbot.smoothness, framework.combat.aimbot.smoothness
            local MouseSens = UserSettings().GameSettings.MouseSensitivity
            local Scale = 1.5 / MouseSens
            if framework.combat.aimbot.autocalc then
                XOffset, YOffset = 0.1 * Scale, 0.1 * Scale
            end
            mousemoverel((Position.X - MouseLocation.X) * XOffset, (Position.Y - MouseLocation.Y) * YOffset)
        end
    end

    if FullBright then
        if framework.variables.lighting:FindFirstChild("StimEffect") then
            sethiddenproperty(framework.variables.lighting.StimEffect, "Brightness", 0.1)
            sethiddenproperty(framework.variables.lighting.StimEffect, "Contrast", 0)
            sethiddenproperty(framework.variables.lighting.StimEffect, "Enabled", true)
            sethiddenproperty(framework.variables.lighting.StimEffect, "Saturation", 2)
        end
    else
        sethiddenproperty(framework.variables.lighting.StimEffect, "Brightness", 0.2)
        sethiddenproperty(framework.variables.lighting.StimEffect, "Contrast", 0.8)
        sethiddenproperty(framework.variables.lighting.StimEffect, "Enabled", false)
        sethiddenproperty(framework.variables.lighting.StimEffect, "Saturation", 1)
    end
end)